import React, { Component } from 'react'
import Nav from './components/Nav'
import axios from 'axios'

class Profile extends Component {
  constructor(props) {
    super(props)
    this.state = {
      user: [],
    }
  }

  componentDidMount() {
    axios.get('/api/users/').then((res) => {
      const user = res.session.user
      this.setState({ user })
    })
  }

  render(user) {
    return (
      <>
        <Nav />
        <p>{user.name}</p>
      </>
    )
  }
}

export default Profile
